import React, { Component } from 'react';
import { Line, Bar, Pie } from 'react-chartjs-2';
import { defaults } from 'react-chartjs-2';
import { render } from '@testing-library/react';

class Infograph extends Component {
constructor (props) {
    super(props);
    this.state = {
        chartData: {
           labels:  ['today', 'yesterday', 'the day before'],
           datasets: [{
            label: 'UV index',
            data: [300, 400, 350],
           },
           {
            label: 'SNP point Change',
            data: [700, 500, 450],
           } ]
        }
    }
}
render() {
    return (
        <div className="chart">
            <Line 
                data= {this.state.chartData}

                options = {{
                    title: {
                        display: true,
                        text: 'SNP points vs Sunlight',
                        fontSize: 25
                    },
                    legend: {
                       display: true,
                       position: 'left'
                    }
                }}


            />
        </div>
    )
}
};

export default Infograph;
